commits.content:
.time-main-container {
    color: white;
    height: 100%;
    width: 140px;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: rgb(112, 111, 111);
}

.time-container {
    background-color: red;
    height: 100%;
    width: 70%;
}
.clock-container {
    @extend: --center-div;
    background-color: green;
    height: 100%;
    width: 30%;
}
